import React from "react";
import { Link } from "react-router-dom";

function NotFound(){
    return (
        <div>
        <img className="w-full h-full" src="https://cdni.iconscout.com/illustration/premium/preview/page-not-found-3702347-3119129.png?f=avif&h=700"/>
        <Link className=" mt-2 flex items-center text-3xl" to={"/Products"}>Back to Home Page </Link>
        </div>);
}
export default NotFound;
